DRAW_BARREL1: .word 0x0 0x0 0xFF6A5D5D 0xFF6A5D5D 0xFF6A5D5D 0x0 0x0 0x0 0xFF6A5D5D 0xFFD79B4C 0xFFD79B4C 0xFF777066 0xFF6A5D5D 0x0 0xFF6A5D5D 0xFFD79B4C 0xFFD79B4C 0xFFD79B4C 0xFFD79B4C 0xFF777066 0xFF6A5D5D 0xFF6A5D5D 0xFFD79B4C 0xFF000000 0xFFD79B4C 0xFFD79B4C 0xFFD79B4C 0xFF6A5D5D 0xFF6A5D5D 0xFF777066 0xFFD79B4C 0xFFD79B4C 0xFFD79B4C 0xFFD79B4C 0xFF6A5D5D 0x0 0xFF6A5D5D 0xFF777066 0xFFD79B4C 0xFFD79B4C 0xFF6A5D5D 0x0 0x0 0x0 0xFF6A5D5D 0xFF6A5D5D 0xFF6A5D5D 0x0 0x0 
