BARREL_TIMING: .word 0
PLAYER_STATE: .word 0
NUMBER_OF_JUMPS: .word 0
LEVEL: .word 0
xPos:	.word 25
yPos:	.word 110
white: .word 0xFFFFFFFF
green: .word 0xFF36FF00
red: .word 0xFFFF2155
blue: .word 0xFF2BB5CF
newline: .asciiz "\n"
.text
main:
	li $t0, BASE_ADDRESS # $t0 stores the base address for display
	la $t1, STARTSCREEN
	addi $t3, $t1 65536
	
	jal print_background
	li $t0, 0
	
	lw $s2, COIN_ANIMATION_ADDRESS_SCREEN_START
	jal draw_coin_animation
	li $s2, 48212
	sw $s2, COIN_ANIMATION_ADDRESS_SCREEN_START
	
start_of_game_loop:
	lw $s2, COIN_ANIMATION_ADDRESS_SCREEN_START
	jal draw_coin_animation
	li $v0, 32
	li $a0, 64
	syscall
	
	li $t2, 0xffff0000 # address of key pressed
	lw $t3, ($t2)
	beq $t3, 1, keypress_happend_beggining
	j start_of_game_loop
keypress_happend_beggining:

	lw $t3, 4($t2)
	beq $t3, 0x61 respond_to_a_start
	beq $t3, 0x73 respond_to_s_start
	beq $t3, 0x64 respond_to_d_start
	
respond_to_a_start:
	li $t0, 0
	li $t2, 48212
	sw $t2, COIN_ANIMATION_ADDRESS_SCREEN_START
	j start_of_game_loop
respond_to_s_start:
	beq $t0, 0, draw_in_level
	beq $t0, 1, end
respond_to_d_start:
	li $t0, 1
	li $t2, 48484
	sw $t2, COIN_ANIMATION_ADDRESS_SCREEN_START
	j start_of_game_loop
	
draw_in_level:
	la $t0, BACKGROUND # $t0 stores the base address for display
	la $t1, BACKGROUND1
	addi $t3, $t1 65536
	
	jal print_background
game_start:

	li $t0, BASE_ADDRESS # $t0 stores the base address for display
	la $t1, BACKGROUND
	addi $t3, $t1 65536
	
	jal print_background
	
	li $v0, 42
	li $a0, 0
	li $a1, 2
	syscall
	
	bne $a0, 1, cont36
	li $s2, 3172
	j cont37
cont36:
	li $s2, 3956
cont37:
	sw $s2, COIN1_ADDRESS
	la $s3, COIN_ASSET1
	jal draw_coin
	
	li $v0, 42
	li $a0, 0
	li $a1, 2
	syscall
	
	bne $a0, 1, cont38
	li $s2, 27724
	j cont39
cont38:
	li $s2, 28044
cont39:
	sw $s2, COIN2_ADDRESS
	la $s3, COIN_ASSET2
	jal draw_coin
	
	li $v0, 42
	li $a0, 0
	li $a1, 2
	syscall
	
	bne $a0, 1, cont40
	li $s2, 31472
	j cont41
cont40:
	li $s2, 51524
cont41:
	sw $s2, COIN3_ADDRESS
	la $s3, COIN_ASSET3
	jal draw_coin
	# $t0 holds address of current x position
	# $t1 holds address of current y position
	# $t2 holds key pressed address Temp
	# $t3 holds if key pressed and what key pressed Temp
	# $t4 holds state of player 0(on the ground facing left) 1(on the ground facing right) 2(in the air) 3(on a ladder)
	# $t5 holds jumps
	
	lw $t0, xPos # intial x position
	lw $t1, yPos # intial y position
	li $t4, 0 # intial state of player
	li $t5, 0 # jumps
	
	jal calculate_offset # stores offset in $s1
	la $s7 STANDLEFT
	jal draw
loop:
	li $v0, 32
	li $a0, 24
	syscall
	
	jal detect_coin
	
	lw $v1 BARREL1
	la $t2 BARREL1
	jal barrel_decision
	
	lw $v1 BARREL2
	la $t2 BARREL2
	jal barrel_decision
	
	lw $v1 BARREL3
	la $t2 BARREL3
	jal barrel_decision
	
	lw $v1 BARREL4
	la $t2 BARREL4
	jal barrel_decision
	
	lw $v1 BARREL5
	la $t2 BARREL5
	jal barrel_decision
	
	lw $t5, NUMBER_OF_JUMPS
	beq $t5, 0, cont # checks if more jumps are needed
	addi $t5, $t5, -1
	sw $t5, NUMBER_OF_JUMPS
	jal jump
	j cont2
cont:
	beq $t4, 3, cont2
	lw $t5, NUMBER_OF_JUMPS
	bne $t5, $zero, cont2 # reached apex of jump
	jal gravity
cont2:
	li $t2, 0xffff0000 # address of key pressed
	lw $t3, ($t2)
	beq $t3, 1, keypress_happend
	la $s0, SPRINTLEFT
	bne $s0, $s7, cont13
	la $s7, STANDLEFT
	jal delete_old_drawing
	jal draw
	j cont14
cont13:
	la $s0, SPRINTRIGHT
	bne $s0, $s7, cont14
	la $s7, STANDRIGHT
	jal delete_old_drawing
	jal draw
cont14:
	j loop
keypress_happend:
	lw $t3, 4($t2) # holds value of pressed key
	# $s0 holds the color white
	# $s1 holds offset of current position
	
	jal calculate_offset # stores offset in $s1
	
	beq $t3, 0x61 respond_to_a
	beq $t3, 0x73 respond_to_s
	beq $t3, 0x64 respond_to_d
	beq $t3, 0x77 respond_to_w
	beq $t3, 0x70 reset
respond_to_a:
	lw $t0, xPos
	lw $t1, yPos
	blt $t0, 4, loop
	jal delete_old_drawing
	addi $t0, $t0, -1
	sw $t0, xPos
	lw $t1, yPos
	jal calculate_offset
	la $s7 SPRINTLEFT
	lw $t4, PLAYER_STATE
	bne $t4, 3, cont16
	jal on_ladder
cont16:
	jal draw
	lw $s2 BACKGROUND($s1)
	bne $s2, 0xFF2BB5CF, loop
	li $t4, 2
	sw $t4, PLAYER_STATE
	j loop
respond_to_s:
	lw $s4, BACKGROUND+512($s1) # grab color of background
	bne $s4, 0xFF36FF00, cont5 # green
	li $t4, 0
	sw $zero, PLAYER_STATE
	la $s7 STANDRIGHT
	j cont9
cont5:
	lw $s4, BACKGROUND($s1)
	lw $t4, PLAYER_STATE
	beq $t4, 3, cont9
	bne $s4, 0xFFFFF200, cont6 # yellow
	li $t4, 3
	sw $t4, PLAYER_STATE
	la $s7 LADDER
	lw $t1, yPos
	addi $t1, $t1, 1
	sw $t1, yPos
	j cont9
cont6:
	lw $s4, BACKGROUND+512($s1) # grab color of background one below
	beq $s4, 0xFFFF2155, loop
cont9:
	lw $s4, BACKGROUND+512($s1)
	jal delete_old_drawing
	lw $t1, yPos 
	addi $t1, $t1, 1
	sw $t1, yPos
	jal calculate_offset
	jal draw
	j loop
respond_to_d:
	lw $t0, xPos
	lw $t1, yPos
	beq $t0, 124, loop
	jal delete_old_drawing
	lw $t0, xPos
	addi $t0, $t0, 1
	sw $t0, xPos
	lw $t1, yPos
	jal calculate_offset
	la $s7 SPRINTRIGHT
	lw $t4, PLAYER_STATE
	bne $t4, 3, cont15
	jal on_ladder
cont15:
	jal draw
	lw $s2 BACKGROUND($s1)
	bne $s2, 0xFF2BB5CF, loop
	li $t4, 2
	sw $t4, PLAYER_STATE
	j loop
respond_to_w: 
	# add case for in ladder position
	lw $s4, BACKGROUND($s1) # grab color of background
	bne $s4, 0xFF36FF00, cont7 #green
	lw $t4, PLAYER_STATE
	li $t4, 3
	sw $t4, PLAYER_STATE
	jal delete_old_drawing
	lw $t1, yPos
	addi $t1, $t1, -1
	sw $t1, yPos
	jal calculate_offset
	la $s7 LADDER
	jal draw
	j loop
cont7:
	addi $s1, $s1, -1024
	lw $s4, BACKGROUND($s1)
	jal calculate_offset
	bne $s4, 0xFFFFF200, cont8
	jal delete_old_drawing
	lw $t1, yPos 
	addi $t1, $t1, -2
	sw $t1, yPos
	jal calculate_offset
	jal draw
	lw $t4, PLAYER_STATE
	beq $t4, 0, cont8
	li $t4, 0
	sw $t4, PLAYER_STATE
	j loop
cont8:
	beq $t4, 3, cont10
	beq $t4, 2, loop # not on the ground go back
	lw $t5, NUMBER_OF_JUMPS
	li $t5, 12
	sw $t5, NUMBER_OF_JUMPS
	li $t4, 2
	sw $t4, PLAYER_STATE
cont10:
	jal delete_old_drawing
	lw $t1, yPos 
	addi $t1, $t1, -1
	sw $t1, yPos
	jal calculate_offset
	jal draw
	j loop 
calculate_offset:
	li $s1, 128
	mul $s1, $t1, $s1 # y*128
	add $s1, $s1, $t0 # y*128 + x
	mul $s1, $s1, 4	# calculate address # (y*128 + x)*4
	jr $ra
gravity:
	# Store $ra in stack
    	addi $sp $sp -4
    	sw $ra 0($sp)

	lw $s4, BACKGROUND+512($s1) # grab color of background
	beq $s4, 0xFFFF2155 cont3
	j cont4
cont3:
	lw $t4, PLAYER_STATE
	li $t4, 0
	sw $t4, PLAYER_STATE
	jr $ra
cont4:
	move $t6, $ra
	jal delete_old_drawing
	lw $t1, yPos
	bne $t1, 128, cont55
	j remove_heart
cont55:
	addi $t1, $t1, 1 # go down one pixel
	sw $t1, yPos
	jal calculate_offset
	jal draw
	# Restore $ra from stack
    	lw $ra 0($sp)
    	addi $sp $sp 4
	jr $ra
jump:
	move $t6, $ra
	jal delete_old_drawing
	lw $t1, yPos
	addi $t1, $t1, -1 # go up one pixel
	sw $t1, yPos
	jal calculate_offset
	jal draw
	move $ra $t6
	jr $ra
	
delete_old_drawing:
	move $s2, $s1
	addi $s2, $s2 -5104
	li $s6, 0
first_loop2:
	li $s5, 0
	addi $s2, $s2, 484
	beq $s6, 70, finish_loop2
second_loop2:
	beq $s5, 7, first_loop2
	lw $s4, BACKGROUND($s2) # grab color of background
	sw $s4, BASE_ADDRESS($s2)
	addi $s2, $s2, 4
	addi $s5, $s5, 1
	addi $s6, $s6, 1
	j second_loop2	
finish_loop2:
	jr $ra
draw:
	# $s2 holds top left of image in base_address
	# $s3 holds counter for the image
	# $s4 holds the color of the image
	# $s5 counter for loop condition
	# $s6 counter for loop condition
	move $s2, $s1
	addi $s2, $s2 -5104
	move $s3, $s7
	li $s6, 0
	
first_loop:
	li $s5, 0
	addi $s2, $s2, 484
	beq $s6, 70, finish_loop
second_loop:
	beq $s5, 7, first_loop
	lw $s4, ($s3) # grab color of background
	beq $s4, 0x0, cont12
	sw $s4, BASE_ADDRESS($s2)
cont12:
	addi $s2, $s2, 4
	addi $s3, $s3, 4
	addi $s5, $s5, 1
	addi $s6, $s6, 1
	j second_loop	
finish_loop:
	jr $ra	
draw_barrel:

	# Store $ra in stack
    	addi $sp $sp -4
    	sw $ra 0($sp)

	# $s2 holds top left of image in base_address
	# $s3 holds counter for the image
	# $s4 holds the color of the image
	# $s5 counter for loop condition
	# $s6 counter for loop condition
	move $s2, $s1
	addi $s2, $s2 -3568
	move $s3, $s7
	li $s6, 0
	
first_loop5:
	li $s5, 0
	addi $s2, $s2, 484
	beq $s6, 49, finish_loop5
second_loop5:
	beq $s5, 7, first_loop5
	lw $s4, BASE_ADDRESS($s2)
	bne $s4, 0xFF0059C1, cont53
	j remove_heart
cont53:
	lw $s4, ($s3) # grab color of background
	beq $s4, 0x0, cont42
	sw $s4, BASE_ADDRESS($s2)
cont42:
	addi $s2, $s2, 4
	addi $s3, $s3, 4
	addi $s5, $s5, 1
	addi $s6, $s6, 1
	j second_loop5
finish_loop5:
	# Restore $ra from stack
    	lw $ra 0($sp)
    	addi $sp $sp 4
	jr $ra	
	
draw_entity:
	addi $s2, $s2, -420
	li $s6, 0
first_loop3:
	li $s5, 0
	addi $s2, $s2, 420
	beq $s6, 161, finish_loop3
second_loop3:
	beq $s5, 23, first_loop3
	lw $s4, ($s3) # grab color of background
	sw $s4, BACKGROUND($s2)
	sw $s4, BASE_ADDRESS($s2)
	addi $s3, $s3, 4
	addi $s2, $s2, 4
	addi $s5, $s5, 1
	addi $s6, $s6, 1
	j second_loop3	
finish_loop3:
	jr $ra
	
draw_coin:
	addi $s2, $s2, -484
	li $s6, 0
first_loop4:
	li $s5, 0
	addi $s2, $s2, 484
	beq $s6, 49, finish_loop4
second_loop4:
	beq $s5, 7, first_loop4
	lw $s4, ($s3) # grab color of background
	sw $s4, BACKGROUND($s2)
	sw $s4, BASE_ADDRESS($s2)
	addi $s3, $s3, 4
	addi $s2, $s2, 4
	addi $s5, $s5, 1
	addi $s6, $s6, 1
	j second_loop4
finish_loop4:
	jr $ra
on_ladder:
	la $s7, LADDER
	jr $ra
barrel_drawer:
	addi $sp $sp -4
    	sw $ra 0($sp)
    	addi $sp $sp -4
    	sw $s2 0($sp)
	move $t7, $s7
	addi $t3, $t2, 12
	lw $t0, ($t3)
	addi $t3, $t2, 16
	lw $t1, ($t3)
	jal calculate_offset
	jal delete_old_drawing
	bne $t1, 126, cont21
	sw $zero, ($t2)
	addi $t3, $t2, 4
	sw $zero, ($t3)
	li $t8 63
	addi $t3, $t2, 12
	sw $t8, ($t3)
	li $t8, 12
	addi $t3, $t2, 16
	sw $t8 ($t3)
	j cont22
cont21:
	lw $s4, BACKGROUND+500($s1) # grab color of background
	beq $s4, 0xFFFF2155 cont17
	lw $s4, BACKGROUND+524($s1) # grab color of background
	beq $s4, 0xFFFF2155 cont17
	addi $t1, $t1, 1 # go down one pixel
	
	addi $t3, $t2, 16
	sw $t1 ($t3)
	j cont20
cont17:
	blt $t0, 124, cont18
	li $t8, -1
	sw $t8, ($t2)
cont18:
	bgt $t0, 4, cont19
	li $t8, 1
	sw $t8, ($t2)
cont19:
	lw $t8 ($t2)
	add $t0, $t0, $t8
cont20:
	addi $t3, $t2, 12
	sw $t0 ($t3)
	jal calculate_offset
	addi $t3, $t2, 4
	lw $t9, ($t3)
	bne $t9, 0, cont30
	la $s7, DRAW_BARREL0
	j cont33
cont30:
	bne $t9, 1, cont31
	la $s7, DRAW_BARREL1
	j cont33
cont31:
	bne $t9, 2, cont32
	la $s7, DRAW_BARREL2
	j cont33
cont32:
	bne $t9, 3, cont33
	la $s7, DRAW_BARREL3
	j cont33
cont33:
	jal draw_barrel
	lw $t0, ($t2)
	add $t9, $t9, $t0
	bne $t9, -1, cont34
	li $t9, 3
	j cont22
cont34:
	bne $t9, 4, cont22
	li $t9, 0
cont22:
	addi $t3, $t2, 4
	sw $t9, ($t3)
	lw $t0, xPos
	lw $t1, yPos
	jal calculate_offset
	move $s7, $t7
	lw $s2 0($sp)
    	addi $sp $sp 4
	lw $ra 0($sp)
    	addi $sp $sp 4
	jr $ra
	
barrel_decision:
	move $t6 $ra
	beq $v1, 0, cont23
	jal barrel_drawer
	j cont35
	
cont23:
	jal check_random
cont35:
	move $ra $t6
	jr $ra
	
check_random:
	addi $sp $sp -4
    	sw $t0 0($sp)
    	
	li $v0, 42
	li $a0, 0
	li $a1, 200
	syscall

	lw $t0, BARREL_TIMING
	beq $t0, 0, cont57
	addi $t0, $t0, -1
	sw $t0, BARREL_TIMING
	j cont28
cont57:
	
	bne $a0, 1, cont27
	li $t9, 1
	sw $t9 ($t2)
	addi $t0, $t0, 50
	sw $t0, BARREL_TIMING
cont27:
	bne $a0, 0, cont28
	li $t9, -1
	sw $t9 ($t2)
	addi $t0, $t0, 50
	sw $t0, BARREL_TIMING
cont28:
	lw $t0 0($sp)
    	addi $sp $sp 4
	jr $ra
detect_coin:
	# Store $ra in stack
    	addi $sp $sp -4
    	sw $ra 0($sp)

	lw $t0, xPos
	lw $t1, yPos
	
	addi $t1, $t1, -5
	jal calculate_offset
	
	lw $s4, BACKGROUND($s1) # grab color of background
	
	bne $s4, 0xFFDC9927, cont43
	lw $s2, COIN1_ADDRESS
	la $s3, BLACK_BOX
	jal draw_coin
	j cont46
cont43:
	bne $s4, 0xFFDC9928, cont44
	lw $s2, COIN2_ADDRESS
	la $s3, BLACK_BOX
	jal draw_coin
	j cont46
cont44:
	bne $s4, 0xFFDC9929, cont45
	lw $s2, COIN3_ADDRESS
	la $s3, BLACK_BOX
	jal draw_coin
	j cont46
cont46:
	lw $t0, COINS
	addi $t0, $t0, 1
	sw $t0, COINS
	bne $t0, 1, cont47
	la $s3, COIN1
cont47:
	bne $t0, 2, cont48
	la $s3, COIN2
cont48:
	bne $t0, 3, cont49
	
	lw $t0, LEVEL
	bne $t0, 0, cont58
	addi $t0, $t0, 1
	sw $t0, LEVEL
	la $t0, BACKGROUND # $t0 stores the base address for display
	la $t1, BACKGROUND2
	addi $t3, $t1 65536
	jal print_background
	jal redraw_hearts
	j reset_game
cont58:
	lw $t0, LEVEL
	bne $t0, 1, cont62
